    <style>
        *{
            user-select: none;
        }
        main{
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
        }
        .loading-container{
            display: flex;
            justify-content: center;
            align-items: center;
            /* flex-direction: column; */
            gap: 18px;
        }
        .loading-container svg{
            fill: var(--theme);
            width: 64px;
            height: 64px;

            animation: rotate 4s linear infinite;
        }
        .loading-container h3{
            font-family: fontR;
            color: var(--text-b);
            font-size: 24px;
            text-align: center;
        }

        .loading-text{
            font-family: fontM;
            font-size: 18px;
            opacity: 50%;
            color: var(--text-b);
            text-align: center;

            position: absolute;
            top: 70%;
            left: 50%;
            transform: translate(-50%,-50%);

            animation: fade 2s ease-in-out infinite;
        }

        @keyframes rotate {
            from {
                transform: rotate(0deg);
            }
            to {
                transform: rotate(360deg);
            }
        }

        @keyframes fade {
            0% {
                opacity: 0.2;
            }
            50% {
                opacity: 0.7;
            }
            100% {
                opacity: 0.2;
            }
        }

    </style>
